// NPM Modules
import knex from 'knex';
import knexConfigs from '../knex.configs';

// Local Modules
import { LoggerUtil } from '../src/utils';

function up(pg) {
  return pg.schema
    .createTable('product', (table) => {
      table.increments('id').primary();
      table.string('componyName').notNullable();
      table.string('name').notNullable();
      table.string('categoryName').notNullable();
      table.string('image').notNullable();
      table.integer('price').notNullable();
      table.dateTime('created_at');
      table.dateTime('updated_at');
    })
    .createTable('admin', (table) => {
      table.increments('id').primary();
      table.string('mail').notNullable();
      table.string('phone');
      table.string('address');
      table.string('logo');
      table.string('info');
      table.dateTime('created_at');
      table.dateTime('updated_at');
    })
    .createTable('gifts', (table) => {
      table.increments('id').primary();
      table.string('companyName');
      table.string('flowerName');
      table.string('image');
      table.string('price');
      table.dateTime('created_at');
      table.dateTime('updated_at');
    })
    .createTable('bouquets', (table) => {
      table.increments('id').primary();
      table.string('companyName');
      table.string('flowerName');
      table.string('image');
      table.string('price');
      table.dateTime('created_at');
      table.dateTime('updated_at');
    })
    .createTable('wreaths', (table) => {
      table.increments('id').primary();
      table.string('companyName');
      table.string('flowerName');
      table.string('image');
      table.string('price');
      table.dateTime('created_at');
      table.dateTime('updated_at');
    })

  // .createTable('helpful_topics', (table) => {
  //   table.increments('id').primary();
  //   table.string('title').notNullable();
  //   table.text('text').notNullable();
  //   table.dateTime('created_at');
  // })
  // .createTable('cubesat_control', (table) => {
  //   table.increments('id').primary();
  //   table.string('title').notNullable();
  //   table.text('url').notNullable();
  //   table.dateTime('created_at');
  // })
  // .createTable('games', (table) => {
  //   table.increments('id').primary();
  //   table.string('title').notNullable();
  //   table.text('url').notNullable();
  //   table.dateTime('created_at');
  // })
  // .createTable('our_partners', (table) => {
  //   table.increments('id').primary();
  //   table.string('title').notNullable();
  //   table.text('text').notNullable();
  //   table.dateTime('created_at');
  // })
  // .createTable('our_team', (table) => {
  //   table.increments('id').primary();
  //   table.string('title').notNullable();
  //   table.string('image').notNullable();
  //   table.text('text').notNullable();
  //   table.dateTime('created_at');
  // });
}

async function init() {
  try {
    const options = process.env.NODE_ENV === 'production'
      ? knexConfigs.production
      : knexConfigs.development;
    const pg = knex(options);
    await up(pg);
    console.log('Successfully created all tables ... ');
  } catch (error) {
    LoggerUtil.error(error.message);
  }
}

init();

