// NPM Modules
import bCrypt from 'bcryptjs';
import knex from 'knex';

// Local Modules
import knexConfigs from '../knex.configs';
import config from '../src/config/variables.config';

const { SUPERADMIN_PASSWORD } = config;

async function seed(pg) {
  // Inserts seed entries

  await pg('users').insert([
    {
      username: 'superadmin',
      password: bCrypt.hashSync(SUPERADMIN_PASSWORD, bCrypt.genSaltSync(10), null),
      role: 'superadmin',
      created_at: new Date().toISOString()
    }
  ]);

  await pg('product').insert([
    {
      companyName: 'Brabion',
      name: ' 6',
      categoryName: 'Gifts',
      price: 15800

      // email: 'sdkfhsdhf@mail.ru',
      // phone: '654654545',
      // adress: 'sdfsdfsd',
      // password: 'sdfsdf',
      // logo: '/khsfksjhdf/.jpg',
      // info: 'sfghsdu',
      // paymentMethod: ['sdjfgd'],
    },
    {
      companyName: 'Flowers Armenia',
      name: ' 5',
      categoryName: 'Bouquets',
      price: 21000
    },
    {
      companyName: 'Armen Flowers',
      name: ' 4',
      categoryName: 'Wreaths',
      price: 32400
    }

  ]);

  await pg('bouquets').insert([
    {
      companyName: 'Brabion',
      flowerName: ' 1',
      price: 15800
    },
    {
      companyName: 'Brabion 2',
      flowerName: ' 2',
      price: 15800
    },
    {
      companyName: 'Brabion 3',
      flowerName: ' 3',
      price: 15800
    },
    {
      companyName: 'Brabion 4',
      flowerName: ' 4',
      price: 15800
    }

  ]);

  await pg('gifts').insert([
    {
      companyName: 'Brabion',
      flowerName: ' 1',
      price: 15800
    },
    {
      companyName: 'Brabion 2',
      flowerName: ' 2',
      price: 15800
    },
    {
      companyName: 'Brabion 3',
      flowerName: ' 3',
      price: 15800
    },
    {
      companyName: 'Brabion 4',
      flowerName: ' 4',
      price: 15800
    }

  ]);

  await pg('wreaths').insert([
    {
      companyName: 'Brabion',
      flowerName: ' 1',
      price: 15800
    },
    {
      companyName: 'Brabion 2',
      flowerName: ' 2',
      price: 15800
    },
    {
      companyName: 'Brabion 3',
      flowerName: ' 3',
      price: 15800
    },
    {
      companyName: 'Brabion 4',
      flowerName: ' 4',
      price: 15800
    }

  ]);
}

async function init() {
  try {
    const options = process.env.NODE_ENV === 'production'
      ? knexConfigs.production
      : knexConfigs.development;
    const pg = knex(options);
    await seed(pg);
    console.log('Successfully inserted all data ... ');
    process.kill(process.pid);
  } catch (error) {
    console.error(error.message);
  }
}

init();

